function SponsoredBills({ sponsoredBills }) {
    return (
        <div>
            { sponsoredBills && (
                <table>
                    {sponsoredBills.map((bill, index) => (
                    <tbody key={`bill-${index}`}>
                        <tr>
                            <td>Bill Number</td>
                            <td>{`${bill.type}-${bill.number}`}</td>
                        </tr>
                        <tr>
                            <td>Introduced</td>
                            <td>{bill.introducedDate}</td>
                        </tr>
                        <tr>
                            <td>Bill Title</td>
                            <td>{bill.title}</td>
                        </tr>
                        <tr>
                            <td>Latest Action</td>
                            <td>{`${bill.latestAction.text} - ${bill.latestAction.actionDate}`}</td>
                        </tr>
                    </tbody>
                    ))}
                </table>
            )}
        </div>
    );
}

export default SponsoredBills;
